import React from "react";
//Imports
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faLinkedinIn } from "@fortawesome/free-brands-svg-icons";
import { faTwitter } from "@fortawesome/free-brands-svg-icons";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
//Types
import { SocialMedia } from "../Types/Types";
//Styles
import "./ContactMe.css";

const ContactMe = () => {
	const socialMedia: SocialMedia[] = [
		{
			name: "Linkedin",
			link: "https://www.linkedin.com/in/justin-cabrera-a725001a2/",
			tag: "Justin Cabrera",
		},
		{ name: "Gmail", tag: "justincabrera854@gmail.com" },
	];

	const copy_to_clipboard = () => {
		console.log("hello");
	};

	return (
		<div className='contact-container'>
			<header>
				<h1>You can find me in the following platforms</h1>
			</header>
			<ul>
				<li className='linkedin'>
					<a
						href='https://www.linkedin.com/in/justin-cabrera-a725001a2/'
						target='_blank'>
						<FontAwesomeIcon
							icon={faLinkedinIn}
							size='2x'
							className='icon-contact'
						/>{" "}
						Justin Cabrera
					</a>
				</li>
				<li className='twitter'>
					<a href='https://twitter.com/Hareds_' target='_blank'>
						<FontAwesomeIcon
							icon={faTwitter}
							size='2x'
							className='icon-contact'
						/>
						Hareds_
					</a>
				</li>
				<li className='gmail' onClick={copy_to_clipboard}>
					<FontAwesomeIcon
						icon={faEnvelope}
						size='2x'
						className='icon-contact'
					/>
					justincabrera854@gmail.com
				</li>
			</ul>
		</div>
	);
};

export default ContactMe;
